import React from 'react';





export default function CardActivity(activities) {


console.log(activities);



  return (
    <div>
        {
            activities.length?.map(act=>{
                return(
                    <div>
                    <h2>{act.name}</h2>
                    <h2>{act.difficulty}</h2>
                    <h2>{act.duration}</h2>
                    <h2>{act.season}</h2>
                    {/* <h2>
                        {
                          act.countries?.map(c=>c)
                        }
                    </h2> */}
                
                    </div>
                )
            })
        }
    </div>
  )
};
